@Grivonect🤖 will let you know asap — we’re just waiting for Pawel’s response.
@Peeeeeeeeeeeel As for the Neko Health project — it’s super interesting, but it focuses mostly on hardware and overall health tracking. There are also solutions dedicated purely to whole-body image scanning, like the VECTRA WB360, but scans cost around $250–600 each, and the equipment itself is likely well into the six-figure range.

I believe AI-powered health scanners will be the future, but they need to be highly accessible. There are already many promising projects, for example using affordable NIR scanners or high-quality iris camera add-ons, that can track a wide range of important general health indicators. Can’t wait to see the market adopt them in the near future.
